<head>
	<title>Fitness Gym Landing Page</title>
	<style>
		/* CSS for the landing page */
		body {
			background-color: #f5f5f5;
			font-family: Arial, sans-serif;
			margin: 0;
			padding: 0;
		}

		header {
			background-color: #FF8C00;
