			text-align: center;
		}

		h1 {
			font-size: 3rem;
			margin: 0;
		}

		nav {
			background-color: #fff;
			padding: 10px;
			text-align: center;
		}

		nav ul {
			list-style-type: none;
			margin: 0;
			padding: 0;
		}

		nav li {
			display: inline;
			margin: 20px;
		}

		nav a {
			color: #FF8C00;
			text-decoration: none;
			font-size: 1.5rem;
		}

		section {
			background-color: #fff;
			display: flex;
			justify-content: center;
			padding: 50px;
		}

		section h2 {
			color: #FF8C00;
			font-size: 2rem;
			margin-bottom: 30px;
			text-transform: uppercase;
			letter-spacing: 2px;
		}

		.card {
			background-color: #f5f5f5;
			box-shadow: 0 0 10px rgba(0,0,0,0.2);
			display: flex;
			flex-direction: column;
			padding: 50px;
			text-align: center;
			width: 300px;
			height: 400px;
			margin: 20px;
			transition: transform 0.3s;
		}

		.card:hover {
			transform: scale(1.1);
		}

		.card h3 {
			margin-top: 0;
		}

		.card img {
			height: 200px;
			margin: 20px;
		}

		.card p {
			margin: 20px;
		}

		.call-to-action {
			background-color: #FF8C00;
			color: #fff;
			display: flex;
			flex-wrap: wrap;
			justify-content: space-between;
			padding: 50px;
		}

		.call-to-action h2 {
			font-size: 2rem;
			margin-top: 0;
			margin-bottom: 50px;
			width: 100%;
			text-align: center;
		}

		form {
			display: flex;
			flex-wrap: wrap;
			justify-content: center;
			width: 100%;
		}

		input[type="email"] {
			border-radius: 5px;
			border: none;
			margin: 10px;
			padding: 10px;
			width: 60%;
			font-size: 1.2rem;
		}

		input[type="submit"] {
			background-color: #fff;
			border: 2px solid #fff;
			border-radius: 5px;
			color: #FF8C00;
			cursor: pointer;
			font-size: 1.2rem;
			margin: 10px;
			padding: 10px;
			transition: background-color 0.2s;
		}

		input[type="submit"]:hover {
			background-color: #FF8C00;
			color: #fff;
		}

		footer {
			background-color: #FF8C00;
			color: #fff;
			padding: 20px;
			text-align: center;
		}

		footer p {
			margin: 0;
		}
	</style>
</head>
